    // accepted
    // result = 95
    // execution duration = 252
    public int lengthOfLongestSubstring2(String s) {
        int longest = 0;
        char[] sc = s.toCharArray();
        if (sc.length == 1) {
            return 1;
        }
        for (int i = 0; i < sc.length; i++) {
            int curLen = sc.length - i;
            if (longest >= curLen) {
                break;
            }
            for (int j = i + 1; j < sc.length; j++) {
                int has = 0;
                int k = j - 1;
                while (k >= i) {
                    if (sc[k] == sc[j]) {
                        has = 1;
                        break;
                    }
                    k--;
                }
                if (has == 1) {
                    if (longest < j - i) {
                        longest = j - i;
                    }
                    break;
                } else {
                    if (longest < j - i + 1) {
                        longest = j - i + 1;
                    }
                }
            }
        }
        return longest;
    }

    // time limit exceed
    // result = 95
    // execution duration = 333
    public int lengthOfLongestSubstring(String s) {
        int longest = 0;
        int sl = s.length();
        for (int i = 0; i < sl; i++) {
            int curLen = sl - i;
            if (longest >= curLen) {
                break;
            }
            for (int j = i + 1; j < sl; j++) {
                String c = s.substring(j, j + 1);
                if (s.substring(i, j).contains(c)) {
                    break;
                }
                int temp = s.substring(i, j + 1).length();
                if (temp > longest) {
                    longest = temp;
                }
            }

        }
        return longest;
    }
